var tipuesearch = {"pages":[{"url":"./pages/about/","text":"2016Fall 修課成員網誌","title":"About","tags":"misc"},{"url":"./bian-ji-startbatshi-qi-neng-zi-xing-kai-qi-leo.html","text":"開啟SciTE編輯start.bat找到python.exe開啟之後再讀取launchLeo.py然後在哪裡 自行開啟Leo from 陳士正 on Vimeo .","title":"編輯start.bat使其能自行開啟Leo","tags":"Misc"},{"url":"./kai-qi-cmsimfiysi-fu-qi.html","text":"先ipconfig找到現在所使用的IP,再找到wsgi.py的檔案將它丟到SciTE編輯裡面的IP改成現在使用的IP,再用python讀wsgi.py如果要關掉就按ctrl+C 開啟CMsimfiy伺服器 from 陳士正 on Vimeo .","title":"開啟CMsimfiy伺服器","tags":"Misc"},{"url":"./zi-zhi-wang-lu-xian.html","text":"先準備好8蕊網路線 RJ-45接頭和剪刀還有壓線鉗 用剪刀將網路線外皮剝除,之後將雙絞線進行分類,兩端的網路接頭皆為T568B為一般傳輸用網路線,T568B配線顏色順序為白橙、橙、白綠、藍、白藍、綠、白棕、棕再將前端不整齊的部分修剪整齊套入RJ45接頭用壓線鉗壓僅完成壓線 跳線:兩台電腦資料對傳用一頭用T568B另一頭用T568A配線,T568A配線順序為白綠、綠、白橙、藍、白藍、橙、白棕、棕 網路線製作 from 陳士正 on Vimeo .","title":"自製網路線","tags":"Misc"},{"url":"./2017-04-21shang-ke-nei-rong-lian-xi.html","text":"在Virtualbox中,以橋接網路卡設定,建立一台 Ubuntu伺服主機 sudo apt update幫我們把下載的網站資料update到最新,如果不行就用 sudo rm /var/lib/dpkg/lock 把lock刪除掉 , sudo apt install nginx 安裝nginx ,用ifconfig再到外部的瀏覽器打上IP:80就可以看到,如果像要知道檔案在哪裡就 cd /var/www/html , ls -l ,sudo vi index.nginx-debian.html 就可更改 上課內容練習 from 陳士正 on Vimeo .","title":"2017-04-21上課內容練習","tags":"Misc"}]};